Kids United - "L'Oiseau Et l'Enfant" (Clip - Officiel) - Extrait de l'album "Tout Le Bonheur Du Monde" dispo ici : http://rldd.co/KU-TLBDM - 1er album  "Un Monde Meilleur" toujours disponible : http://rldd.co/UnMondeMeilleur - Plus d'infos : http://facebook.com/WeAreKidsUnited et http://twitter.com/WeAreKidsUnited

Kids United : Erza, Esteban, Gabriel, Gloria et Nilusi.

/// 

Le 2ème album des Kids United "Tout Le Bonheur Du Monde" sera disponible le 19 Août prochain en partenariat avec l'UNICEF. 

L’UNICEF fournit aux réfugiés et aux personnes déplacées en centre d’accueil des kits de premier secours, des kits d’hygiène et des couvertures de survie. Leur objectif est aussi de « remettre les enfants à l’école » en donnant le matériel scolaire nécessaire. Plus d'infos : http://www.unicef.fr/

